import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import $ from 'jquery';

class App extends Component {
  constructor(){
    super();
    this.state = { data: [] };
  }

  async loadPlayers(){
    let players;
    let formData = new FormData();
    formData.append('queryMethod', 'getAllPlayers');
    await $.ajax({
      type: 'POST',
      url: '/StirlandsDAP/stirlandscricket/src/api/dbInferface.php',
      processData: false,
      contentType: false,
      dataType: 'json',
      data: formData,
      async: false,
      success: function(response){
         players = response;
         console.log(response);
      }
    });
  
    return players;
  }
  
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>

          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}
export default App;
